void check_keyboard(int *line_y, int thickness) {
    static int extended_key = 0;
    int PS2_data = *PS2_ptr;
    int isVALID = PS2_data & 0x8000;
    
    if (isVALID) {
        unsigned char key_code = PS2_data & 0xFF;
        
        if (key_code == 0xE0) {
            extended_key = 1;
        }
        else if (extended_key) {
            extended_key = 0;
            
            if (key_code == 0x75) { 
                *line_y -= 15;
                if (*line_y < 0) *line_y = 0;
            }
            else if (key_code == 0x72) { 
                *line_y += 15;
                if (*line_y > SCREEN_HEIGHT - thickness) {
                    *line_y = SCREEN_HEIGHT - thickness;
                }
            }
        }
    }
}

//bouncing audio - similar to lab 6
void playAudio() {
    volatile int *audio_ptr = (int *)AUDIO_BASE;
    int frequency = 1000;
    int counter = 0;
    int output_value = 0x00FFFFFF; // Max amplitude for square wave

    while (frequency > 100) {
        int half_period = SAMPLE_RATE / (2 * frequency);

       if (counter < half_period) {
    	output_value = 0x00FFFFFF;
	} else {
    	output_value = 0x00000000;
}

        if (counter >= 2 * half_period) {
            counter = 0;
            frequency -= 10;
        }

        int fifospace = *(audio_ptr + 1);
        int out_space = (fifospace >> 16) & 0xFF;
        
        if (out_space >= 2) {
            *(audio_ptr + 2) = output_value;
            *(audio_ptr + 3) = output_value;
        } else {
            for (volatile int i = 0; i < 1000; i++);
        }

        counter++;
    }
}

