void interrupt_handler() {
    uint32_t edge_cap = PUSH_BUTTON_BASE[3];  // Read edge capture register

    if (edge_cap & 1) {  // If KEY0 was pressed
        PUSH_BUTTON_BASE[3] = edge_cap;  // Clear the interrupt flag

        if (game_state == START_SCREEN) {
            //reset_game();
            for (int i = 0; i < 2; i++) {
                clear_screen();
                wait_for_vsync();
                pixel_buffer_start = PIXEL_CTRL_BASE[1];
            }
            game_state = PLAYING;
        }
    }
}

void setup_interrupts() {
    PUSH_BUTTON_BASE[2] = 0b0001;  // Enable KEY0 interrupt
    PUSH_BUTTON_BASE[3] = 0b0001;  // Clear any existing interrupt flags

    // Set interrupt vector table (platform-dependent)
    void (*interrupt_vector)() = interrupt_handler;
    asm volatile ("csrw mtvec, %0" :: "r"(interrupt_vector));

    // Enable global interrupts
    asm volatile (
        "csrw mstatus, %0\n"
        "csrs mie, %1"
        :: "r"(0b1000), "r"(0x40000)
    );
}

int main(void) {
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    volatile int *KEYs = (int *)KEY_BASE;
    
    // Game state variables
    enum GameState { START_SCREEN, PLAYING, GAME_OVER };
    enum GameState game_state = START_SCREEN;
    
    int N = 1;
    int difficulty = 1;
    bool changed = false;
    int colour[8] = {0xffff, 0xf800, 0x07e0, 0x001f, 0xffff, 0xf800, 0x07e0, 0x001f};
    int x_box[N], y_box[N];
    int colour_box[N];
    int dx[N], dy[N];
    int thickness = 50;
    int line_y = SCREEN_HEIGHT/2;
    int prev_line_y = line_y;
    
    // Initialize game
    void reset_game() {
        score = 0;
        difficulty = 1;
        changed = false;
        
        for(int i = 0; i < N; i++) {
            x_box[i] = 315;
            y_box[i] = 120;
            dx[i] = ((rand() % 2) * 2) - 1;
            dy[i] = ((rand() % 2) * 2) - 1;
            colour_box[i] = colour[rand() % 8];
        }
        
        *(volatile int *)LEDR_BASE = 0; // Clear LEDs
        clear_screen();
    }

    // Set up double buffering
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();

    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    clear_screen();
	
    
while (1) {
        // Handle input only for START_SCREEN state here
        if (game_state == START_SCREEN) {
            int edge_cap = *(KEYs + 3);
            if (edge_cap & 1) {  // KEY0 pressed
                *(KEYs + 3) = edge_cap;
                reset_game();
                for (int i = 0; i < 2; i++) {
                  clear_screen();
                  wait_for_vsync();
                  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
                }
                game_state = PLAYING;
            }
        }

        switch (game_state) {
            case START_SCREEN:
				for (int i = 0; i < 2; i++) {
					draw_game_start();
					wait_for_vsync();
					pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			}

                //draw_game_start();
                break;
                
            case PLAYING:
                // Normal game loop
                //clear_screen();
                
                /* Erase previous frame */
                for(int i = 0; i < N; i++) {                
                    draw_big_box(x_box[i] - dx[i]*difficulty, y_box[i] - dy[i]*difficulty, 0x0);
                    
                    if (x_box[0] >= 318){//315 work
                    	clear_screen();
                    	printf("here");
                    } else if (x_box[0]<=11){
                    	clear_screen();
                    }
                }
                draw_thick_vertical_line(10, prev_line_y - 15, 50 + 30, 5, 0x0);
                
                // Handle paddle movement input
                check_keyboard(&line_y, thickness);
                
                // Update game state
                if (score % 3 == 0 && changed) {
                    difficulty++;
                    changed = false;
                }
                
                // Update ball positions
                for(int i = 0; i < N; i++) {
                    // Boundary checks
                    if(x_box[i] + dx[i] <= 5 || x_box[i] + 3 + dx[i] >= 319) dx[i] *= -1;
                    if(y_box[i] + dy[i] <= 5 || y_box[i] + 3 + dy[i] >= 240) dy[i] *= -1;
                    
                    x_box[i] += dx[i] * difficulty;
                    y_box[i] += dy[i] * difficulty;
                }

                // Draw current frame
                for(int i = 0; i < N; i++) {
                    draw_box(x_box[i], y_box[i], colour_box[i]);
                }
                
                // Keep paddle in bounds
                line_y = (line_y < 0) ? 0 : 
                       (line_y > SCREEN_HEIGHT - thickness) ? SCREEN_HEIGHT - thickness : line_y;
                
                draw_thick_vertical_line(10, line_y, 50, 5, 0xffff);
                prev_line_y = line_y;
				if (score % 3 == 0 && score > last_speed_increase_score) {
                last_speed_increase_score = score;
				difficulty++;
				if (difficulty >= 2){
					difficulty=2;
				}
                printf("Speed increased! dx = %d, dy = %d\n", dx[0], dy[0]);
            }


                // Collision detection
                if (x_box[0] +4 <= 15&&
                    y_box[0] + 4 >= line_y && y_box[0] <= line_y + thickness) {
                    dx[0] = -dx[0];
                    playAudio();
                    score++;
                    changed = true;
                    display_score(score);
                }
                // Game over condition - ball gets past paddle
                else if (x_box[0] <= 9) {
                    loseAudio();
                    *(volatile int *)LEDR_BASE = 0x3FF;
                    game_state = GAME_OVER;
                    
                    // Draw to both buffers to prevent flicker
                        draw_game_over_screen();
						
                        wait_for_vsync();
                        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
                    
                }
                break;
                
            case GAME_OVER:
			// Draw to both buffers initially to prevent flicker
			for (int i = 0; i < 2; i++) {
				draw_game_over_screen();
				wait_for_vsync();
				pixel_buffer_start = *(pixel_ctrl_ptr + 1);
			}

			// Stable waiting state - keeps screen static
			while (game_state == GAME_OVER) {
				// Check for KEY0 press without redrawing
				int edge_cap = *(KEYs + 3);
				if (edge_cap & 1) {  // KEY0 pressed
					*(KEYs + 3) = edge_cap;
					reset_game();
					for (int i = 0; i < 2; i++) {
					  clear_screen();
					  wait_for_vsync();
					  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
					}
					game_state = PLAYING;
					break; // Exit the waiting loop
				}
				//wait_for_vsync(); // Maintain timing but skip buffer swap
			}
			break;
				}

        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    }
}